CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login` (IN `p_username` VARCHAR(50), IN `p_password` VARCHAR(50), OUT `p_result` INT)   BEGIN
  DECLARE v_count INT;
  
  SELECT COUNT(*) INTO v_count
  FROM usuario
  WHERE username = p_username AND password = p_password;
  
  IF v_count > 0 THEN
    SET p_result = 1;
  ELSE
    SET p_result = 0;
  END IF;
END$$

